// src/components/Step1.js
import React, { useState } from 'react';

const Step1 = ({ formData, updateFormData, nextStep, prevStep }) => {
  const [name, setName] = useState(formData.name || '');
  const [email, setEmail] = useState(formData.email || '');
  const [phone, setPhone] = useState(formData.phone || '');
  const [position, setPosition] = useState(formData.position || '');

  const handleSubmit = (e) => {
    e.preventDefault();
    updateFormData({ name, email, phone, position });
    nextStep();
  };

  return (
    <div className="form-container">
      <h2>Primary Contact</h2>
      <p>
        Please enter the contact information for the primary person who will manage and
        oversee your Audiology Plus onboarding. This contact will have administrative access to
        all aspects of our service and be the person we communicate with most frequently.
      </p>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="name">Primary Contact name</label>
          <input
            id="name"
            type="text"
            value={name}
            onChange={(e) => setName(e.target.value)}
            placeholder="Enter full name"
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="email">Primary Contact email</label>
          <input
            id="email"
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            placeholder="Enter email address"
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="phone">Phone number</label>
          <input
            id="phone"
            type="tel"
            value={phone}
            onChange={(e) => setPhone(e.target.value)}
            placeholder="(201) 555-0123"
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="position">Position</label>
          <input
            id="position"
            type="text"
            value={position}
            onChange={(e) => setPosition(e.target.value)}
            placeholder="Enter job title"
            required
          />
        </div>
        <div className="button-group">
          <button type="button" onClick={prevStep} className="prev-button">Prev</button>
          <button type="submit" className="next-button">Next</button>
        </div>
      </form>
    </div>
  );
};

export default Step1;
